import React from 'react';

const Header = () => {
    return (
        <div className="header">
            <div className="header-left">
                <div>logo</div>
            </div>
            <div className="header-right">
                <div className="menu">
                    <div className="menu-item">Startsida</div>
                    <div className="menu-item">Om mig</div>
                    <div className="menu-item">Kompetens</div>
                    <div className="menu-item">Erfarenhet</div>
                    <div className="menu-item">Portofölj</div>
                    <div className="menu-item">Kontakt</div>
                </div>
            </div>

            {/* <div className="main-cover-image"></div>
            <div className="main-cover-overlay"></div>
            <div className="main-header-wrapper">
                <div className="main-header-title">Front-End utvecklare</div>
                <div className="main-header-legend">Det är några ord som definerar mig i mn roll som Webbutvecklare/Front-End utevcklare</div>
                <button>Kontakta mig</button>
            </div> */}
        </div>
    );
};

export default Header;
